import React, { useState } from 'react';
import Searchbar from './Searchbar';
import { Link } from 'react-router-dom';
import ProfilePhoto from './ProfilePhoto';

const Navbar = () => {
  const [navbarImage, setNavbarImage] = useState('/images/genz.jpg');

  const updateNavbarImage = (newImage) => {
    setNavbarImage(newImage);
  };

  return (
    <div className='bg-gray-400 flex flex-row px-14 shadow-xl items-center justify-between p-'>
      <div>
        <h1 className='text-3xl text-blue-700 font-bold'> EthioBet</h1>
      </div>

      <div>
        <Searchbar />
      </div>

      <div className='flex justify-between space-x-4'>
        <Link to='/'>
          <p className='font-bold text-lg'>Home</p>
        </Link>
        <Link to='/about'>
          <p className='font-bold text-lg'>About</p>
        </Link>
        <ProfilePhoto imageUrl={navbarImage} profileLink='/profile' updateNavbarImage={updateNavbarImage} />
      </div>
    </div>
  );
};

export default Navbar;
